]

const Team = () => {
  return (
    <section className='our_team' >
        <div className="container">
            <div className="team_content">
                <h6 className="subtitle">Our Team</h6>
                <h2>Meet With <span className="highlight"> Our Team </span> </h2>
            </div>
            

        </div>

    </section>
  );
};

export default Team;
